        public static bool ValidSeedv2(int gameId, bool report = false)
        {
            // Day 20 needs to rain
            if (Weather.getWeather(20, gameId) != Weather.WeatherType.Rain)
            {
                return false;
            }


            // Need a quest on the 20th
            var quest20 = Quests.GetItemDeliveryQuest(gameId, 20, 1, new() { "Robin", "Lewis", "Shane" }, false, false, 0);
            if (quest20.Type == Quests.QuestType.None)
            {
                return false;
            }

            if (quest20.Person != "Shane")
            {
                return false;
            }


            int availableRecipes = 1;
            int currentRecipes = 1;
            string reportString = "";
            // Find an early trash dish
            int day = 1;
            bool valid = false;
            for(day = 1;day<=5;day++)
            {
                if (day == 3)
                {
                    continue;
                }
                var trash = Trash1_6.Trash.getTrash(gameId, day, Trash1_6.Trash.Can.Gus, 0.1);
                if (trash.Id != "DishOfTheDay")
                {
                    continue;
                }

                int neededSteps = -1;
                if (day == 1)
                {
                    StepResult result = StepPredictions.Predict(gameId, day - 1, 0, new List<string>() { "Lewis", "Robin", "Shane" });
                    if (result.Dish != 215 || result.DailyLuck < trash.MinLuck)
                    {
                        continue;
                    }
                    neededSteps = 0;
                }
                else
                {

                    for (int steps = 0; steps < 50; steps++)
                    {
                        StepResult result = StepPredictions.Predict(gameId, day - 1, steps, new List<string>() { "Lewis", "Robin", "Shane" });
                        if (result.Dish == 215 && result.DailyLuck >= trash.MinLuck)
                        {
                            neededSteps = steps;
                            break;
                        }
                    }
                    if (neededSteps == -1)
                    {
                        continue;
                    }
                }
                valid = true;

                reportString = $"First Trash Luck: {trash.MinLuck}\tSteps: {neededSteps}";
                break;
            }

            if (!valid)
            {
                return false;
            }

            HashSet<string> trashItems = new();
            // Start looking for quests the following day
            if (!ValidSeedRecursive(true, gameId, day+1, trashItems, reportString,report:report))
            {
                return false;
            }


            return true;
        }

        public static bool ValidSeedRecursive(bool first, int gameId, int startDay, HashSet<string> trashItems, string reportString = "", int questsForWeek = 0, int questCount=0, int currentRecipes=1, int availableRecipes=1, int foundQuests=0, int friendship=0, int springRain=0, int summerRain = 0, string quests = "", string trashString = "", bool report = false, int nonRainSpringQuest = 0, HashSet<Trash1_6.Trash.TrashItem> dayTrashFull = null,int firstSummerQuest = 9999)
        {
            for (int day = startDay; day <= 56; day++)
            {
                Weather.WeatherType type = Weather.getWeather(day, gameId);
                bool isRain = new HashSet<Weather.WeatherType> { Weather.WeatherType.Rain, Weather.WeatherType.Storm, Weather.WeatherType.GreenRain }.Contains(type);
                if (day % 7 == 0)
                {
                    questsForWeek = 0;
                }
                if (day != startDay || first)
                {
                    first = false;
                    if (day % 7 == 1)
                    {
                        availableRecipes++;
                    }
                    if (day == 22)
                    {
                        availableRecipes++;
                    }
                    //bool isRain = new HashSet<Weather.WeatherType> { Weather.WeatherType.Rain, Weather.WeatherType.Storm, Weather.WeatherType.GreenRain }.Contains(type);
                    if (isRain)
                    {
                        if (day < 29)
                        {
                            springRain++;
                        }
                        else if(firstSummerQuest != 9999)
                        {
                            summerRain++;
                        }
                    }

                    // Can't do anything on green rain
                    if (type == Weather.WeatherType.GreenRain)
                    {
                        continue;
                    }


                    double luck = -0.1;
                    // Get list of trash for the day
                    dayTrashFull = new()
                    {
                        Trash1_6.Trash.getTrash(gameId, day, Trash1_6.Trash.Can.Jodi, luck),
                        Trash1_6.Trash.getTrash(gameId, day, Trash1_6.Trash.Can.George, luck),
                        Trash1_6.Trash.getTrash(gameId, day, Trash1_6.Trash.Can.Lewis, luck),
                        Trash1_6.Trash.getTrash(gameId, day, Trash1_6.Trash.Can.Emily, luck)
                    };
                    dayTrashFull.RemoveWhere(x => x.Id == "");
                }

                // Day of and day before festivals can't have a quest
                if (day == 38 || day == 39 || day == 23 || day == 24 || day == 12 || day == 13 || day == 55 || day == 56)
                {
                    continue;
                }

                // Find quest
                var quest = Quests.GetItemDeliveryQuest(gameId, day, currentRecipes, new() { "Robin", "Lewis", "Shane" }, false, false, 0);
                if (quest.Type == Quests.QuestType.None)
                {
                    continue;
                }
                if (quest.Person != "Shane")
                {
                    continue;
                }



                var dayTrash = new HashSet<string>(dayTrashFull.Select(x => x.Id));
                // See if we have access to the quest item
                if (goodItems.Contains(quest.Id) || trashItems.Contains(quest.Id) || dayTrash.Contains(quest.Id))
                {
                    int dayOffset = firstSummerQuest - 29;
                    // Too early for some items
                    if (quest.Id == "260" && day < 34 + dayOffset || quest.Id == "254" && day < 41 + dayOffset || quest.Id == "256" && day < 40 + dayOffset || quest.Id == "262" && day < 33 + dayOffset || quest.Id == "264" && day < 35 + dayOffset)
                    {
                        continue;
                    }
                    // Only accept potato if there has been enough rain
                    if (quest.Id == "192" && springRain + nonRainSpringQuest < 4)
                    {
                        continue;
                    }
                    // If weekend, needs to rain
                    if (day % 7 == 0 || day % 7 == 6)
                    {
                        if (!isRain)
                        {
                            continue;
                        }
                    }

                    // Account for 3rd quest on week that ends Spring 20
                    if (questsForWeek < 2 || day == 20)
                    {
                        if (day > 28 && firstSummerQuest == 9999 && day != 31)
                        {
                            firstSummerQuest = day;
                        }
                        if (isRain && day < 29)
                        {
                            nonRainSpringQuest++;
                        }
                        questsForWeek++;
                        questCount++;
                        if (questCount == 6)
                        {
                            availableRecipes++;
                        }
                    }
                    quests += $"\t{day}\tRecipes: {currentRecipes}\t{Item.Get(quest.Id).Name}";

                    // Success! Report if needed
                    if (questCount == 8)
                    {
                        if (report && springRain > 3 && summerRain > 8 )
                        {
                            FileStream fs = new FileStream($"MarriageSeededCurate.txt", FileMode.Append);
                            StreamWriter stream = new StreamWriter(fs);
                            string line = $"{gameId}\t{quests}\t{day}\t{reportString}\tSpring Rain: {springRain}\tSummer Rain: {summerRain}\t{trashString}";
                            //string line = $"{gameId}";
                            stream.WriteLine(line);
                            stream.Close();
                            Console.WriteLine(line);
                        }
                        return true;
                    }

                    trashItems.UnionWith(dayTrash);
                    trashString += $"{String.Join(", ", dayTrashFull)}";

                    if (trashItems.Contains(quest.Id))
                    {
                        trashItems.Remove(quest.Id);
                    }
                }
                // Quest didnt work, try with more recipes known
                else
                {
                    if (currentRecipes < availableRecipes)
                    {
                        // Crops don't change
                        if (!cropItems.Contains(quest.Id))
                        {
                            if (ValidSeedRecursive(false, gameId, day, trashItems, reportString, questsForWeek, questCount, currentRecipes + 1, availableRecipes, foundQuests, friendship, springRain, summerRain, quests, trashString, report, nonRainSpringQuest, dayTrashFull, firstSummerQuest))
                            {
                                // If reporting, find all combinations
                                if (!report)
                                {
                                    return true;
                                }
                            }
                        }
                    }
                    // Need quest on 20th
                    if (day == 20)
                    {
                        return false;
                    }
                }

            }
            return false;
        }
        public static bool ValidSeed(int gameId,bool report = false)
        {
            string reportString = "";
            // Day 20 needs to rain
            if (Weather.getWeather(20,gameId) != Weather.WeatherType.Rain)
            {
                return false;
            }

            // Get dish of the day
            //var trash = Trash1_6.Trash.getTrash(gameId, 20, Trash1_6.Trash.Can.Gus, 0.1);
            //if (trash.Id != "DishOfTheDay")
            //{
            //    return false;
            //}

            // Need a quest on the 20th
            var quest20 = Quests.GetItemDeliveryQuest(gameId, 20, 1, new() { "Robin", "Lewis", "Shane" }, false, false, 0);
            if (quest20.Type == Quests.QuestType.None)
            {
                return false;
            }

            if (quest20.Person != "Shane")
            {
                return false;
            }

            //reportString = $"Day20 Trash Luck: {trash.MinLuck}";

            // Make sure there is enough rain to grow snips before 20th
            //
            int springRainCount = 1;
            int day;
            bool hasQuest = false;
            string quests = "";

            // Once snips are ready, look for quests
            //day++;
            HashSet<string> trashItems = new ();
            HashSet<Trash1_6.Trash.TrashItem> trashItemsFull = new();
            int questCount = 1;
            int questsForWeek = 0;
            int summerRainCount = 0;
            bool firstSummerQuest = false;
            int availableRecipes = 1;
            int totalRecipes = 1;

            for (day = 2; day < 54; day++)
            {
                if (day == 21)
                {
                    totalRecipes++;
                }
                if (day == 39 || day == 24 || day == 13)
                {
                    continue;
                }
                HashSet<Trash1_6.Trash.TrashItem> dayTrashFull;
                HashSet<string> dayTrash;
                Quests.QuestResults quest;
                double luck;
                if (!hasQuest)
                {
                    // Day of and day before festivals can't have a quest
                    if (day == 38 || day == 39 || day == 23 || day == 24 || day == 12 || day == 13)
                    {
                        continue;
                    }
                    quest = Quests.GetItemDeliveryQuest(gameId, day, totalRecipes, new() { "Robin", "Lewis", "Shane" }, false, false, 0);
                    if (quest.Type == Quests.QuestType.None)
                    {
                        continue;
                    }
                    if (quest.Person != "Shane")
                    {
                        continue;
                    }
                    // First quest needs to also have trash so we can step manip for it
                    var trash = Trash1_6.Trash.getTrash(gameId, day, Trash1_6.Trash.Can.Gus, 0.1);
                    if (trash.Id != "DishOfTheDay")
                    {
                        continue;
                    }
                    luck = 0.1;
                    // Get list of trash for the day
                    dayTrashFull = new()
                    {
                        Trash1_6.Trash.getTrash(gameId, day, Trash1_6.Trash.Can.Jodi, luck),
                        Trash1_6.Trash.getTrash(gameId, day, Trash1_6.Trash.Can.George, luck),
                        Trash1_6.Trash.getTrash(gameId, day, Trash1_6.Trash.Can.Lewis, luck),
                        Trash1_6.Trash.getTrash(gameId, day, Trash1_6.Trash.Can.Emily, luck)
                    };

                    dayTrashFull.RemoveWhere(x => x.Id == "");



                    //Trash1_6.Trash.getAllTrash(gameId, day, 0.1);
                    dayTrash = new HashSet<string>(dayTrashFull.Select(x => x.Id));

                    // See if we have access to the quest item
                    if (!goodItems.Contains(quest.Id) && !dayTrash.Contains(quest.Id))
                    {
                        continue;
                    }

                    // No parsnip at this time
                    if (quest.Id == "24")
                    {
                        continue;
                    }
                    int neededSteps = -1;
                    for (int steps = 0; steps < 1000; steps++)
                    {
                        StepResult result = StepPredictions.Predict(gameId, day - 1, steps, new List<string>() { "Lewis", "Robin", "Shane" });
                        if (result.Dish == 215 && result.DailyLuck >= trash.MinLuck)
                        {
                            neededSteps = steps;
                            break;
                        }
                    }
                    quests += $"\t{day}\t{Item.Get(quest.Id).Name}";
                    reportString = $"First Trash Luck: {trash.MinLuck}\tSteps: {neededSteps}";
                    hasQuest = true;
                    continue;
                }
                if (day > 28 && firstSummerQuest || day <= 28)
                {
                    Weather.WeatherType type = Weather.getWeather(day, gameId);
                    bool isRain = new HashSet<Weather.WeatherType> { Weather.WeatherType.Rain, Weather.WeatherType.Storm, Weather.WeatherType.GreenRain }.Contains(type);
                    if (day > 28)
                    {
                        if (isRain)
                        {
                            summerRainCount++;
                        }

                        if (summerRainCount < 5)
                        {
                           // continue;
                        }
                    }else if (isRain)
                    {
                        springRainCount++;
                    }

                    //Schedules change on green rain
                    if (type == Weather.WeatherType.GreenRain)
                    {
                        continue;
                    }
                }

                if (day % 7 == 0)
                {
                    questsForWeek = 0;
                }
                if (questsForWeek == 2 && !(day ==20))
                {
                    continue;
                }
                // Day of and day before festivals can't have a quest
                if (day == 38 || day == 39 || day == 23 || day == 24 || day == 12 || day == 13)
                {
                    continue;
                }
                quest = Quests.GetItemDeliveryQuest(gameId, day, totalRecipes, new() { "Robin", "Lewis", "Shane" },false,false,0);
                if (quest.Type == Quests.QuestType.None)
                {
                    if (day == 20)
                    {
                        return false;
                    }
                    continue;
                }

                if (quest.Person != "Shane")
                {
                    continue;
                }

                luck = -0.1;
                // Get list of trash for the day
                dayTrashFull = new()
                {
                    Trash1_6.Trash.getTrash(gameId, day, Trash1_6.Trash.Can.Jodi, luck),
                    Trash1_6.Trash.getTrash(gameId, day, Trash1_6.Trash.Can.George, luck),
                    Trash1_6.Trash.getTrash(gameId, day, Trash1_6.Trash.Can.Lewis, luck),
                    Trash1_6.Trash.getTrash(gameId, day, Trash1_6.Trash.Can.Emily, luck),
                    Trash1_6.Trash.getTrash(gameId, day, Trash1_6.Trash.Can.Gus, luck)
                };

                dayTrashFull.RemoveWhere(x => x.Id == "");


                
                //Trash1_6.Trash.getAllTrash(gameId, day, 0.1);
                dayTrash = new HashSet<string>(dayTrashFull.Select(x => x.Id));

                // See if we have access to the quest item
                if (goodItems.Contains(quest.Id) || trashItems.Contains(quest.Id) || dayTrash.Contains(quest.Id)){

                    // Too early for some items
                    if (quest.Id == "260" && day < 34 || quest.Id == "254" && day < 41 || quest.Id == "256" && day < 40 || quest.Id == "262" && day < 33 || quest.Id == "264" && day < 35)
                    {
                        continue;
                    }
                    // If weekend, needs to rain
                    if (day % 7 == 0 || day % 7 == 6)
                    {
                        if (!(new HashSet<Weather.WeatherType> { Weather.WeatherType.Rain, Weather.WeatherType.Storm, Weather.WeatherType.GreenRain }.Contains(Weather.getWeather(day, gameId))))
                        { 
                            continue; 
                        }
                    }

                    if (!firstSummerQuest && day > 28)
                    {
                        firstSummerQuest = true;
                    }


                    // Account for 3rd quest on week that ends Spring 20
                    if (questsForWeek < 2)
                    {
                        questsForWeek++;
                        questCount++;
                        if (questCount == 6)
                        {
                            totalRecipes++;
                        }
                    }
                    quests += $"\t{day}\t{Item.Get(quest.Id).Name}";
                    if (questCount == 8)
                    {
                        break;
                    }

                    trashItems.UnionWith(dayTrash);
                    trashItemsFull.UnionWith(dayTrashFull);

                    if (trashItems.Contains(quest.Id))
                    {
                        trashItems.Remove(quest.Id);
                    }
                }else if(day == 20)
                {
                    return false;
                }
            }

            // Check for enough quests
            if (questCount < 8)
            {
                return false;
            }
            if (report)
            {
                FileStream fs = new FileStream($"MarriageSeededCurate.txt", FileMode.Append);
                StreamWriter stream = new StreamWriter(fs);
                string line = $"{gameId}\t{quests}\t{day}\t{reportString}\tSpring Rain: {springRainCount}\tSummer Rain: {summerRainCount}\t{String.Join(", ", trashItemsFull)}";
                stream.WriteLine(line);
                stream.Close();
                Console.WriteLine(line);
            }

            return true;
        }
        public static double Search(int startId, int endId, int blockSize, out List<int> validSeeds)
        {
            Stopwatch stopwatch = Stopwatch.StartNew();
            var bag = new ConcurrentBag<int>();
            var partioner = Partitioner.Create(startId, endId, blockSize);
            //for(int seed = startId; seed < endId; seed++) { 
            Parallel.ForEach(partioner, (range, loopState) =>
            {
                for (int seed = range.Item1; seed < range.Item2; seed++)
                {
                    if (ValidSeedv2(seed))
                    {
                        bag.Add(seed);
                        FileStream fs = null;
                        int i = 0;
                        while (fs == null)
                        {
                            try
                            {
                                fs = new FileStream($"MarriageSeededV8_{i}.txt", FileMode.Append);
                            }
                            catch
                            {
                                i++;
                            }
                        }
                        StreamWriter stream = new StreamWriter(fs);
                        stream.Write($"{seed},");
                        Console.WriteLine(seed);
                        stream.Close();
                    }
                }
            });
            double seconds = stopwatch.Elapsed.TotalSeconds;
            Console.WriteLine($"Found: {bag.Count} sols in {seconds.ToString("F2")} s");
            validSeeds = bag.ToList();
            validSeeds.Sort();
            return seconds;
        }
    }
